import {Component} from "react";

class Moviecard extends Component{
render(){
    return(
        <div className="main">
            <div className="movie-card">
                <div className="left">
                    <img alt="poster"></img>
                </div>

                <div className="right">
                    <div className="title">
                      The Avengers  
                    </div>

                    <div className="plot">
                    Supernatural powers shown in the movie
                        </div>

                    <div className="price"> Rs. 199 </div>
                </div>
                </div>
        </div>
    )
}
}
export default Moviecard;
